import React from "react";

function Card({ title, city, rate, desc, schedule, startDate }) {
  const staffGig = () => {};
  return (
    <div>
      {title}
      {city}
      {rate}
      {desc}
      {schedule}
      {startDate}
      <button onClick={staffGig}>Staff Gig</button>
    </div>
  );
}

export default Card;
